import {Helmet} from "react-helmet";
 function Thankyou(props) {

    return(
        <div className="postphoto"style={{backgroundColor:"#125a31"}}>
             <Helmet>
                <style>{'body { background-color: #125a31; }'}</style>
            </Helmet>

            <div class="row">
                <p style={{fontWeight:"700",fontSize:"30px",marginTop:"4%"}}>Thank You</p>
            </div>
        </div>
        );

    }
   
    export default Thankyou;
